/**
 * Locks created during unlock staget will be merged with locks remembered before unlock.
 */
var shouldMergeLocks = true;

/**
 * Changes script mode. Possible values are: 
 * "TOGGLE" - unlocks if saved settings is found and lock if there is no record for layers to be locked
 * "LOCK" - always will try to use saved locks settings. Will do nothing if settings not found
 * "UNLOCK" - always unlock layers and replace locks settings in document metadata
 */
var scriptMode = "TOGGLE"
	
